import React, { Component } from 'react'
//import Carousel from 'react-bootstrap/Carousel'

import FirstPage from './First'
import SecondPage from './Second'

class Signup extends Component {
    constructor(props) {
        super(props);
        this.state = {currentPage: 1};

    }

    render() {
        const navegatePage = (pageNumber) => {
            this.setState({currentPage: pageNumber});
        }

        return <>
                    <div className={this.state.currentPage != 1 ? 'hide-page' : ''}>
                        <FirstPage navMethod={this.navegatePage} />
                    </div>
                    <div className={this.state.currentPage != 2 ? 'hide-page' : ''}>
                        <SecondPage  navMethod={this.navegatePage}/>
                    </div>
                </>;
    }
}

export default Signup;

